import {Component} from 'react';
import Room from './Room'
export default function Rooms(){
    const rooms = [{subj:'cn101',name:'jack'},{subj:'sf210',name:'paul'},{subj:'sf220',name:'piya'}]
    return(
        <section>
            {rooms.map(room=>{
                return(
                    <Room
                    subj = {room.subj}
                    name={room.name}
                    >

                    </Room>
                )
            })}
        </section>
    )
}
